import groovy.json.JsonSlurper
import groovy.xml.XmlSlurper

def FPIGetDetailsResponse = context.expand('${FPIGetDetails#Response}')
FPIGetDetails = new XmlSlurper().parseText(FPIGetDetailsResponse)

def foodGetDetailsResponse = context.expand('${foodGetDetails#Response}')
foodGetDetails = new JsonSlurper().parseText(foodGetDetailsResponse)

// Проверка prescriptionNumber
prescriptionNumberINFO = foodGetDetails.prescriptionNumber.toString()
prescriptionNumberFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.prescriptionNumber.toString()
assert prescriptionNumberINFO == prescriptionNumberFFIS

// Проверка prescriptionPeriod.periodTitle
periodTitleINFO = foodGetDetails.prescriptionPeriod.periodTitle.toString()
periodTitleFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.prescriptionPeriod.periodTitle.toString()
assert periodTitleINFO == periodTitleFFIS

// Проверка feedingType
feedingTypeINFO = foodGetDetails.feedingType.toString()
feedingTypeFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.feedingType.toString()
//assert feedingTypeINFO == feedingTypeFFIS  // На данный момент не реализовано на стороне сервиса "Бесплатное питание для инфомата"

// Проверка productLine
productNameINFO = foodGetDetails.productLine[0].productName.toString()
productNameFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.productLine.productName.toString()
assert productNameINFO == productNameFFIS
productOutputINFO = foodGetDetails.productLine[0].productOutput.toString()
productOutputFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.productLine.productOutput.toString()
assert productOutputINFO == productOutputFFIS
unitINFO = foodGetDetails.productLine[0].unit.toString()
unitFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.productLine.unit.toString()
assert unitINFO == unitFFIS

// Проверка milkShop
milkShopTitleINFO = foodGetDetails.milkShop.title.toString()
milkShopTitleFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.milkShop.title.toString()
assert milkShopTitleINFO == milkShopTitleFFIS
milkShopAddressINFO = foodGetDetails.milkShop.address.toString()
milkShopAddressFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.milkShop.address.toString()
assert milkShopAddressINFO == milkShopAddressFFIS

// Проверка state
stateCodeINFO = foodGetDetails.state.code.toString()
stateFFIS = FPIGetDetails.Body.fpiGetDetailsResponse.state.toString()
assert stateCodeINFO == stateFFIS
stateTitleINFO = foodGetDetails.state.title.toString()
if (stateFFIS == "active" || stateFFIS == "protected" || stateFFIS == "inprogress"){
	assert stateTitleINFO == "Действующий"
	}
if (stateFFIS == "expired"){
	assert stateTitleINFO == "Просрочен"
	}
if (stateFFIS == "finished"){
	assert stateTitleINFO == "Обслужен"
	}

import groovy.json.JsonSlurper
import groovy.xml.XmlSlurper

def getScheduleResponse = context.expand('${getSchedule#Response}')
getSchedule = new XmlSlurper().parseText(getScheduleResponse)

def foodGetDetailsResponse = context.expand('${foodGetDetails#Response}')
foodGetDetails = new JsonSlurper().parseText(foodGetDetailsResponse)

// Сверяем количество day
scheduleDayINFOCount = foodGetDetails.schedule.size()

// Проверка schedule.day
scheduleDayINFO = foodGetDetails.schedule.day
daysGetSchedule = getSchedule.Body.getScheduleResponse.schedule
//log.info daysGetSchedule.day
for (i=0; i<scheduleDayINFOCount; i++){
	for (k=0; k<daysGetSchedule.size(); k++){
		if (daysGetSchedule.isScheduled == true){
			assert daysGetSchedule.day[k] == scheduleDayINFO[i]
		}
		else {
			log.info "У дня" + " " + daysGetSchedule.day[k] + " " + "isScheduled != true"
		}
	}
}

getScheduleMode = getSchedule.Body.getScheduleResponse
getScheduleModeInfo = foodGetDetails.serviceMode

if(getScheduleMode.serviceMode == 'weekly'){
	assert getScheduleModeInfo.code == 'weekly'
	assert getScheduleModeInfo.title == 'Раз в неделю'
}
if(getScheduleMode.serviceMode == 'monthly'){
	assert getScheduleModeInfo.code == 'monthly'
	assert getScheduleModeInfo.title == 'Раз в месяц'
}
if(getScheduleMode.serviceMode == 'twotimes'){
	assert getScheduleModeInfo.code == 'monthly'
	assert getScheduleModeInfo.title == '2 раза в месяц'
}

