import groovy.json.JsonSlurper
import groovy.xml.XmlSlurper
import java.util.ArrayList
import java.time.LocalDate
import java.time.format.DateTimeFormatter

def restResponse = context.expand('${Получить список активных заказов на питание#Response}')
def slurperJson = new JsonSlurper()
def rest = slurperJson.parseText(restResponse)
restBody = rest.foodPrescription

def soapResponse = context.expand('${Получить список бесплатного питания#Response}')
soap = new XmlSlurper().parseText(soapResponse)
soapBody = soap.Body.fpiGetListResponse.foodPrescription

for(i=0; i<soapBody.size(); i++){
	if(soapBody[i].state.toString() in ['active', 'protected', 'inprogress']){
		assert soapBody[i].prescriptionNumber.toString() == restBody[i].prescriptionNumber.toString()
		assert soapBody[i].prescriptionPeriod.toString() == restBody[i].prescriptionPeriod.toString()
		assert soapBody[i].state.toString() == restBody[i].state.code.toString()
		assert restBody[i].state.title.toString() == 'Действующий'
	}
	else {
		log.info 'Статус' + ' ' + soapBody[i].state.toString() + ' ' + 'отсутствует в маппинге'
	}
}

import groovy.json.JsonSlurper
import groovy.xml.XmlSlurper
import java.util.ArrayList
import java.time.LocalDate
import java.time.format.DateTimeFormatter

def restResponse = context.expand('${Получить список активных заказов на питание#Response}')
def slurperJson = new JsonSlurper()
def rest = slurperJson.parseText(restResponse)
restBody = rest.foodPrescription

def soapResponse = context.expand('${Получить список бесплатного питания#Response}')
soap = new XmlSlurper().parseText(soapResponse)
soapBody = soap.Body.fpiGetListResponse.foodPrescription

for(i=0; i<soapBody.size(); i++){
	if(soapBody[i].state.toString() in ['expired', 'finished']){
		assert soapBody[i].prescriptionNumber.toString() == restBody[i].prescriptionNumber.toString()
		assert soapBody[i].prescriptionPeriod.toString() == restBody[i].prescriptionPeriod.toString()
		assert soapBody[i].state.toString() == restBody[i].state.code.toString()
		if(soapBody[i].state.toString() == 'expired'){
			assert restBody[i].state.title.toString() == 'Просрочен'
		}
		if(soapBody[i].state.toString() == 'finished'){
			assert restBody[i].state.title.toString() == 'Обслужен'
		}
	}
	else {
		log.info 'Статус' + ' ' + soapBody[i].state.toString() + ' ' + 'отсутствует в маппинге'
	}
}
